import { BrowserRouterRoute, Routes } from 'react-router-dom';
import Layout from './Layout'  

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
  <Routes>
    <Route>
      <h1>
        eceewd
      </h1>
    <Route path="/" element={< Layout />} />

    </Route>
  </Routes>
  </BrowserRouter>
);
